Always striving towards a goal!  It used to be the pursuit of getting as strong as possible. But I was abusing steroids, had terrible sleep apnea, and didn’t feel all that great. 

@kelleyrubish asked me if I still wanted to have a child…I haven’t pinned since that conversation 2.5 years ago. I’ve leaned way down. All of my biomarkers are the best they’ve been. I feel the best I ever have. My sleep apnea is gone. My VO2 max has climbed up. Im not anywhere near as strong, but still semi strong. 

Nowadays, it’s a shift towards top tier health, strength, and endurance, but the mindset never wavers. 

